"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">4.1 您同意星小夜的登录器有权基于自行考虑，因任何理由，包括但不限于缺乏使用或星小夜的登录器认为您已经违反本协议的条款及精神，而终止您对星小夜的登录器服务与软件的使用权。</p>\n"
