"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">4.2 如果游戏官方指示作者整改星小夜的登录器的内容或停止对星小夜的登录器的开发、制作、维护，星小夜的登录器将会积极、全力配合游戏官方并采取相应的措施，包括但不限于停止向您提供的部分或全部服务。</p>\n"
