"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">4.3 如果赛尔号官方发布了游戏客户端，星夜将会自行停止对星小夜的登录器的开发、制作、维护，收回登录器的使用权并积极引导您使用官方游戏客户端。</p>\n"
